import React, {useState} from 'react';
import Typography from '@mui/material/Typography';
import Button from '@material-ui/core/Button';
import KeyboardArrowRightIcon from '@material-ui/icons/KeyboardArrowRight';
import { FormControlLabel, makeStyles } from '@material-ui/core';
import TextField from '@material-ui/core/TextField';
import Container from '@material-ui/core/Container';
import Radio from '@material-ui/core/Radio';
import RadioGroup from '@material-ui/core/RadioGroup';

const useStyle = makeStyles({
  field: {
    marginTop: 20,
    marginBotton: 20,
    display: 'block'
  }
});


export default function Create() {

  const classes = useStyle();

  const [title, setTitle] = useState('');
  const [details, setDetails] = useState('');
  const [titleError, setTitleError] = useState(false);
  const [detailsError, setDetailsError] = useState(false);
  const [category, setCategories] = useState('');


  const handleSubmit = (e) => 
  { 
    e.preventDefault() 
    setTitleError(false);
    setDetailsError(false);
    
    
    if(title === '')
    {
        setTitleError(true);
    }

    if(details === '')
    {
        setDetailsError(true);
    }

    if(title && details)
    {
        console.log(title, details);
    }
  }

  return (
    <Container>

        <Typography color="textSecondary" variant = "h6" component="h2" gutterBottom>
          Create a New Note
        </Typography>


        <form noValidate autoComplete="off" onSubmit={handleSubmit}>
          <TextField 
            onChange={(e) => setTitle(e.target.value)}
            label="Note title"
            variant="outlined"
            color="secondary"
            fullWidth
            required
            className={classes.field}
            error={titleError}
          />
          <TextField 
            onChange={(e) => setDetails(e.target.value)}
            label="Detailed"
            variant="outlined"
            color="secondary"
            multiline
            rows={4}
            fullWidth
            required
            className={classes.field}
            error={detailsError}
          />

    <RadioGroup value={category}>
      <FormControlLabel control={<Radio />} label="Money" value="money" onClick={(e) => useState(e.target.value)}/>
      <FormControlLabel control={<Radio />} label="To Dos" value="todos"/>
      <FormControlLabel control={<Radio />} label="Reminders" value="reminders"/>
      <FormControlLabel control={<Radio />} label="Work" value="work"/>
    </RadioGroup>
    
    
        <Button
              className={classes.btn}
              type="submit" 
              color="secondary" 
              variant="contained"
              // startIcon={<SendIcon />}
              endIcon={<KeyboardArrowRightIcon />}>
                      Submit
        </Button>

        </form>


    </Container>

  )
}
